function () {
  if (Cypress.config('firstRun')) {
    cy.log('Open the TLS Home page for environment =>' + Cypress.env('ENV')); //Fetch the environment from the command line

    var environment = Cypress.env('ENV'); //Corresponded environment url is picked

    var url = Cypress.env("".concat(environment, "_url")); //Load the URL

    cy.visit(url); //Accept the cookie banner

    cy.acceptCookieBanner();
    Cypress.Cookies.defaults({
      preserve: /main_.*/
    });
    /**
        * If needed can add(err, runnable)
           */

    Cypress.on('uncaught:exception', function () {
      /**
                 * returning false here prevents Cypress from failing the test if there are any exceptions from 3rd party scripts
                 */
      return false;
    });
    Cypress.config('firstRun', false);
    cy.log('TLS Home page for environment =>' + Cypress.env('ENV') + 'loaded');
  }
}

function () {
  cy.log('Test Secenario Completed');
  Cypress.config('firstRun', true);
}

